import React, { Component } from 'react';
import { withRouter } from 'react-router-dom';
import web3 from '.././web3';
import contract from '.././contract';

class Doctor extends Component {
  state = {
    current: 0,
    makepdv: 0,
    tid: 0,
    ppid: 0,
    pid: 0,
    did: 0,
    digno: '',
    test: '',
    bill: 0,
    tpdate: '',
    date: '',
    dpacn: '',
    precau: '',
    tppacn: 0,
    tpdid: 0,
    tpdiagno: '',
    tptests: '',
    tpbill: 0,
    tpmed: '',
    tptid: 0,
    inkpid: 0,
    inkmed: '',
    adpid: 0,
    addt: '',
    adrs: '',
    drprc: '',
    drtid: [],
  };

  handleGetTreatmentDetailsClick = () => {
    this.props.history.push('/treatment-details'); // Navigate to the treatment details route
    this.setState({ current: 1 });
    this.setState({ makepdv: 0 });
  };

  handleUpdatePrecautionClick = () => {
    this.props.history.push('/update-precaution'); // Navigate to the update precaution route
    this.setState({ current: 2 });
    this.setState({ makepdv: 0 });
  };

  handleTreatPatientClick = () => {
    this.props.history.push('/treat-patient'); // Navigate to the treat patient route
    this.setState({ current: 3 });
    this.setState({ makepdv: 0 });
  };

  handleSendMedicationClick = () => {
    this.props.history.push('/send-medication'); // Navigate to the send medication route
    this.setState({ current: 4 });
    this.setState({ makepdv: 0 });
  };

  handleRaiseEmergencyClick = () => {
    this.props.history.push('/raise-emergency'); // Navigate to the raise emergency route
    this.setState({ current: 5 });
    this.setState({ makepdv: 0 });
  };

  render() {
    return (
      <div id="center-content">
        <div className="sidenav">
          <center><h4>Doctor</h4></center>
          <br></br>
          <center>
            <h6>
              <button onClick={this.handleGetTreatmentDetailsClick} className="btn btn-light">
                Get Treatment Details
              </button>
            </h6>
          </center>

          <center>
            <h6>
              <button onClick={this.handleUpdatePrecautionClick} className="btn btn-light">
                Update Precaution
              </button>
            </h6>
          </center>

          <center>
            <h6>
              <button onClick={this.handleTreatPatientClick} className="btn btn-light">
                Treat Patient
              </button>
            </h6>
          </center>

          <center>
            <h6>
              <button onClick={this.handleSendMedicationClick} className="btn btn-light">
                Send Medication to Insurance
              </button>
            </h6>
          </center>

          <center>
            <h6>
              <button onClick={this.handleRaiseEmergencyClick} className="btn btn-light">
                Raise Emergency
              </button>
            </h6>
          </center>
        </div>

        {/* Rest of your component code can go here */}
        {/* You can add forms, display sections, or any other content here */}
      </div>
    );
  }
}

export default withRouter(Doctor);



